import React from 'react';
import './SearchBlock.css'

function SearchBlock() {
  const searchInput = document.querySelector('.search-input')
  // console.log(searchInput.value)

  return (
    <>
    {searchInput.value ? 
      <div className='search-block'>
        {searchInput.value}
      </div> :
    ''}
    </>
  );
}

export default SearchBlock;
